/**
 * @param {string} s
 * @param {number[][]} queries
 * @return {boolean[]}
 */
var canMakePaliQueries = function (s, queries) {
  const dirArr = [];
  s.split("").map((item, index) => {
    if (index === 0) {
      dirArr[0] = {};
      dirArr[0][item] = 1;
    } else {
      const obj = { ...dirArr[index - 1] };
      obj[item] = (obj[item] || 0) + 1;
      dirArr.push(obj);
    }
  });
  return queries.map((item) => {
    let maps = [];
    if (item[0] !== 0) {
      maps = Object.keys(dirArr[item[1]]).map((char) => {
        return (dirArr[item[1]][char] || 0) - (dirArr[item[0] - 1][char] || 0);
      });
    } else {
      maps = dirArr[item[1]];
    }

    const needToggle = Object.values(maps).filter(
      (item) => item % 2 !== 0
    ).length;
    if ((item[1] + 1 - item[0]) % 2 === 0) {
      return needToggle / 2 <= item[2];
    } else {
      return (needToggle - 1) / 2 <= item[2];
    }
  });
};

